import React, { useState } from 'react';
import axios from 'axios';

const Form = () => {
  const [age, setAge] = useState('');
  const [sumInsured, setSumInsured] = useState('');
  const [cityTier, setCityTier] = useState('');
  const [tenure, setTenure] = useState('');
  const [premium, setPremium] = useState('');

  const handleSubmit = async (e) => {
    e.preventDefault();

    try {
      const response = await axios.post('/calculate_premium', {
        age,
        sum_insured: sumInsured,
        city_tier: cityTier,
        tenure
      });

      setPremium(response.data.premium);
    } catch (error) {
      console.error(error);
    }
  };

  return (
    <form onSubmit={handleSubmit}>
      <label>
        Age:
        <input type="text" value={age} onChange={(e) => setAge(e.target.value)} />
      </label>
      <label>
        Sum Insured:
        <input type="text" value={sumInsured} onChange={(e) => setSumInsured(e.target.value)} />
      </label>
      <label>
        City Tier:
        <input type="text" value={cityTier} onChange={(e) => setCityTier(e.target.value)} />
      </label>
      <label>
        Tenure:
        <input type="text" value={tenure} onChange={(e) => setTenure(e.target.value)} />
      </label>
      <button type="submit">Calculate Premium</button>
      {premium && <p>Calculated Premium: {premium}</p>}
    </form>
  );
};

export default Form;
